import React from "react";

function Console(props) {

    function getContentString() {
        let str = "";
        props.content.forEach(element => {
            str += element;
        });
        return str;
    }

    return (
        <div className="border border-black max-h-96 overflow-scroll">
            <p className="text-decoration-line: underline text-center">Console</p>
            <br />
            {
                () => {
                    return(<p>props.content</p>);
                }
                
            }
            {/*
            {props.content.map((element, index) => {
                return (
                <div key={index}>
                    <p>{element}</p>
                </div>)
            })}
        */}
        </div>
    )
}

export default Console;
